 @rsnankivell1962  I don't agree! I live in Eindhoven for more than a month now and the city suprised me in a positive way! There's so much to do for students/young people! It's a pretty vibrant city, also late at night (okay, not everywhere in the city)! It suprised me in a positive way how easy it is in Eindhoven to meet new people, socialize and make new friends, it's really a very social city!  And it's very international! I don't regret moving here, ifI had to do it all over again, I would choose Eindhoven again (over Amsterdam)!!

I also like Dutch cities as Utrecht and Rotterdam. Both very nice cities in their own way!

Ofc Amsterdam is the largest city of the Netherlands, probably also the most vibrant, but that doesn't mean that other Dutch cities aren't nice and interesting!

